import React from 'react';

const Timeline = () => {
    const experiences = [
        {
            title: "Machine Learning Research Intern",
            organization: "Stevens Institute of Technology",
            time: "May 2024 - Aug 2024",
            description: "Worked with Professor Carlo Lipizzi on sentiment analysis using Twitter data to study election distrust trends.",
            link: "https://stevens.edu",
        },
        {
            title: "Software Engineering Intern",
            organization: "whiz.ai",
            time: "Jan 2024 - May 2024",
            description: "Automated workflows and built machine learning models for healthcare applications using TensorFlow and PyTorch.",
            link: "https://whiz.ai",
        },
        {
            title: "Machine Learning and Data Science Intern",
            organization: "Hackensack Meridian Health",
            time: "May 2023 - Aug 2023",
            description: "Developed knowledge graphs and automated single-cell RNA sequencing analysis with gene cluster visualizations.",
            link: "https://hackensackmeridianhealth.org",
        },
        {
            title: "Cybersecurity Project Lead",
            organization: "New Jersey Governor's STEM Scholars",
            time: "Aug 2022 - May 2023",
            description: "Led a team to analyze railroad trespassing using YOLOv4 and Kalman filtering, presenting findings to government councils.",
            link: "https://njstempathways.org",
        },
    ];

    return (
        <div id="timeline" className="w-full py-[0rem] px-4 text-white max-w-[1240px] mx-auto flex flex-col items-center gap-8">
            <div className="max-w-[1240px] mx-auto">
                <h2 className="w-full py-[0rem] px-4 text-white max-w-[1240px] mx-auto flex flex-col items-center gap-8 text-center text-4xl font-bold mb-10 text-center text-8xl">Work Experience</h2>
                <div className="relative border-l-4 border-[#00df9a]">
                    {experiences.map((exp, index) => (
                        <div key={index} className="mb-10 ml-6">
                            <div className="absolute w-4 h-4 bg-[#00df9a] rounded-full -left-2 top-0"></div>
                            <h3 className="text-2xl font-semibold">{exp.title}</h3>
                            <p className="text-gray-400 italic">{exp.organization}</p>
                            <p className="text-sm text-gray-300">{exp.time}</p>
                            <p className="mt-2">{exp.description}</p>
                            <a
                                href={exp.link}
                                target="_blank"
                                rel="noopener noreferrer"
                                className="text-[#00df9a] hover:underline mt-2 inline-block"
                            >
                                Learn more
                            </a>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default Timeline;
